        constructor(props) {
            super(props)
            
            this.state = {
                value:0
            }
        }
        conssetCount=() =>{
            this.setState({value:this.state.value+1})
        }
        render() {
            return (
                <>
                    <div>HocMain</div>
                    <MyComponent value={this.state.value} method={this.setCount}/>
                </>
            )
        }
    }
    return (
       NewComponent
    )
}

